export namespace bookATable {
    namespace model {
        namespace instance {
            namespace eat {
                const special: boolean;
                const time: string;
                const date: string;
                const wish: string;
                const wishes: string[];
            }
        }
        const rules: {
            "#/eat/special": {
                set: string;
                value: string;
            }[];
        };
    }
    const pages: ({
        label: string;
        fields: ({
            type: string;
            layout: string;
            fields: ({
                label: string;
                type: string;
                bind: string;
                min: string;
                items?: undefined;
            } | {
                label: string;
                type: string;
                bind: string;
                items: string[];
                min?: undefined;
            })[];
            bind?: undefined;
            label?: undefined;
            name?: undefined;
            items?: undefined;
            hidden?: undefined;
        } | {
            bind: string;
            type: string;
            label: string;
            layout?: undefined;
            fields?: undefined;
            name?: undefined;
            items?: undefined;
            hidden?: undefined;
        } | {
            name: string;
            type: string;
            label: string;
            bind: string;
            items: string;
            hidden: string;
            layout?: undefined;
            fields?: undefined;
        })[];
    } | {
        label: string;
        fields: {
            type: string;
            label: string;
            placeholder: string;
        }[];
    } | {
        label: string;
        fields: {
            type: string;
            label: string;
            class: string;
        }[];
    })[];
}
